import React, {useState, useEffect} from "react";
import JSON from './latestmovies.json'
import Movieslist from "./Movieslist";

class Latestmovies extends React.Component(){
    constructor(){
        super();
        this.state={
            latest: JSON
        }
    }

    
}
export default Latestmovies;
